(5733,	'2013-08-28 10:17:02',	1,	2,	0,	'Ich möchte die Betreiber des Szene Clubs \"Kaffee Burger\" in Berlin Mitte zu dem Spiel einladen, da er großer Schalke Fan ist und die Imtech Arena nicht kennt. ich weiss er würde sich riesig freuen.\r\n\r\nWir haben bereits über eine Auslistung von Pilsner Urquell und eine Sortimentserweiterung mit Carlsberg Fassbier (so gut wie) vereinbart. \r\n\r\nIch bin mir ganz sicher, sollte der Kunde die Karten bekommen, können wir jährlich mit einer Absatzsteigerung von 80 - 100 HL CB Fassbier rechnen.\r\n\r\nDas würde mich sehr freuen!\r\n\r\nBeste Grüße aus Berlin,\r\nDavid\r\n\r\nP.S.: Der Kunde bittet die Karten an die Firmenadresse zu schicken:\r\n\r\nKaffee Burger GmbH\r\nTorstr. 60\r\n10119 Berlin',	CONV('1', 2, 10) + 0,	'2013-08-28',	54,	5869,	51,	1,	1249,	CONV('0', 2, 10) + 0),
