(6625,	'2014-09-09 17:15:09',	3,	1,	1,	'Begründung: Ich würde den Getränkeverantwortlichen aus dem Rewe Markt in Bahrenfeld gerne einladen um danach einige Stellplatzoptimierungen im Kühlschrank, in der Kastenstraße und speziell im 6er-Träger-Bereich vornehmen zu können.\r\nDer Markt macht ca. 1100 HL pro Jahr und meiner Meinung nach kann man das noch weiter steigern.',	CONV('1', 2, 10) + 0,	'2014-09-09',	1083,	6780,	3,	2,	1438,	CONV('1', 2, 10) + 0),
(6626,	'2014-09-09 17:19:25',	4,	2,	1,	'Begründung: Den Wareneinkaufsleiter aus dem Kaufland im Lurup-Center würde ich gerne einladen um das Verhältnis zu ihm ein wenig aufzubesser.\r\nWir haben schon öfters über eine größeren Umbau und einen Kühlschrank bei Kaufland gesprochen. Sofern es mit den Karten klappen sollte, ist es möglich, dass es auch mit dem Kühler klappt',	CONV('1', 2, 10) + 0,	'2014-09-09',	1083,	6781,	3,	2,	1441,	CONV('1', 2, 10) + 0),
