(7572,	'2015-11-27 21:27:52',	2,	4,	1,	'Herr Düsmez und sein Partner Herr Ziesemer von Wildenradt sind große Fußballfans. Zusätzlich sollen die Betriebsleiter der einzelnen Objekte für das erfolgreiche letzte Jahr belohnt werden. Die GmbH befindet sich auf Expansionskurs und eröffnet ständig neue Objekte/Pubs in Schleswig-Holstein und Hamburg. Auch mit dieser Einladung sichern wir auch zukünftig unsere Position als erster Ansprechpartner bei allen anstehenden Projekten.',	CONV('1', 2, 10) + 0,	'2015-11-27',	1058,	7747,	67,	2,	1682,	CONV('1', 2, 10) + 0),
