(11229,	'2022-03-18 11:38:11',	0,	6,	1,	'Kundenbindung \r\n- Max Sütterlin Inhaber von 3 Hit Märkten. \r\n- Enormer zuwachs vom Absatz . Mit einer der stärksten Märkte bei Grimbergen. Macht immer alle Aktionen mit . \r\n\r\nZusätzlich noch Murat Tüfecki Inhaber von meinem Stärksten Getränke Hoffmann der gerade umgebaut wird zum Gold Markt. ',	CONV('0', 2, 10) + 0,	'2022-03-18',	1123,	11493,	140,	2,	2955,	CONV('0', 2, 10) + 0),
(11230,	'2022-03-18 11:45:46',	2,	6,	1,	'Sven Hasenstab Inhaber von einem Rewe Markt bei Bitburg. Bei Talons nehmen Sie immer schnitt 10 bis 12 Displays und der Absatz ist auch sehr gut und entwickelt sich prächtig. \r\n \r\nzusätzlich Michael Gabel \r\n- Rewe Marktleiter bei Rewe Richrath (16) Märkte. \r\n- Starke Absätze und bei Talons immer starke Mengen. Zusätzlich großer Dynamo Dresden Fan ',	CONV('1', 2, 10) + 0,	'2022-03-18',	1123,	11494,	140,	1,	2989,	CONV('1', 2, 10) + 0),
(11231,	'2022-03-18 11:56:32',	0,	6,	1,	'Inhaber Thomas Hannen \r\n- Inhaber von 3 Rewe Märkten mit sehr starken Absätzen und bei Talons wird seit Jahren auch immer zugeschlagen . Hohe Distri Quote in allen Märkten. Dazu sehr großer Fortuna Düsseldorf FAN . ',	CONV('0', 2, 10) + 0,	'2022-03-18',	1123,	11495,	140,	2,	2956,	CONV('0', 2, 10) + 0),
(11232,	'2022-03-18 12:03:49',	2,	6,	1,	'Inhaber von meinem stärksten Trinkgut und Gesamtkunde in meinem Gebiet. Die Karten vom letzten Spiel sind leider verfallen wegen Corona.  \r\n\r\nzusätzlich Inhaber Hans Peter Fuchs aus Prüm Inhaber von einem Rewe mit starken Absätzen. \r\nHier sind die Karten auch verfallen. \r\n\r\nZusätlich Guido Schuck Inhaber von einem Rewe Markt in Herzogenrath. Starke Absätze und immer sehr gute Mengen bei Talon verkäufen. ',	CONV('1', 2, 10) + 0,	'2022-03-18',	1123,	11496,	140,	2,	2954,	CONV('1', 2, 10) + 0),
(11233,	'2022-03-18 12:13:23',	0,	6,	1,	'Inhaber Patrick Strassfeld \r\n- Inhaber von 2 Edeka Märkten. \r\n- Starke Absätze und gute Distri in den Märkten. \r\n- Großer Düsseldorf Fan . \r\n\r\nDavid Bolz Marktleiter in Aachen in einem meiner stärksten Somersby Märkte. circa 25 bis 30 Displays werden hier jedes Jahr verkauft. Absätze auch ordentlich und bei Talon Abfragen werden auch immer große Mengen genommen. \r\n\r\n',	CONV('0', 2, 10) + 0,	'2022-03-18',	1123,	11497,	140,	1,	2990,	CONV('0', 2, 10) + 0),
